Vídeo @matheusfeh34 obrigada por entrar nessa comigo 🤍

Hoje começa o confinamento do @missminasgeraiscnb e nesse momento eu olho para tudo o que vivi como Miss Ibirité e tenho a certeza que o meu propósito era realmente representar essa cidade que me acolheu e acreditou em mim. Queria ser capaz de agradecer a todos por tanto carinho e amor, darei o meu melhor por cada um de vocês! 
Queria agradecer também a todos os meus parceiros que me ajudaram chegar até aqui, sem vocês a caminhada seria bem mais difícil. Gratidão a Deus por me proporcionar viver momentos tão incríveis que levarei pra sempre comigo. Obrigada ❤️
