Nesse exato momento sinto gratidão, nesse mesmo dia a 1 ano atrás não era capaz de imaginar o quanto Deus estava ansioso para me mostrar tudo o que Ele tinha pensado para mim. Um ano atrás estava me preparando para a final de um concurso e não imaginava o quanto aquela noite seria especial . Exatamente 1 ano atrás fui corada Miss Ibirité e recebi a missão de representar um povo de uma cidade muito linda no Miss Minas Gerais. Minha mente não era era capaz de imaginar a dimensão que tudo isso tomaria, meu coração não era grande o suficiente para caber tanto amor, não me sentia capaz de vencer tantos obstáculos , mas sabia que iria crescer, amadurecer e carregar a minha cidade, que iria me dedicar todos os dias. Hoje uma ano depois, minha mente sabe a dimensão que tudo tomou, meu coração é grande o suficiente para amar todas as pessoas que represento e sim me tornei capaz de ir além dos obstáculos! Agradeço imensamente a todos que estão comigo nesse reinado, agradeço a cidade de Ibirité por ser tão carinho e receptiva, gratidão a todos que sonham junto comigo. Muito obrigada ❤️
